import React, { useState } from 'react';
import { ChevronDown, ChevronRight, CheckCircle, XCircle, Clock, Play, AlertCircle, Eye, Download, FileText } from 'lucide-react';

// 定义节点处理数据的类型
interface NodeProcessingData {
  status: string;
  startTime: string;
  endTime: string;
  duration: string;
  result: string;
  details: string;
  outputSize: string;
  // 添加处理结果相关字段
  hasOutput: boolean;
  outputPreview?: string;
  outputType: string;
  outputUrl?: string;
}

interface FileProcessingData {
  fileId: string;
  fileName: string;
  fileType: string;
  fileSize: string;
  overallStatus: string;
  currentNode: string;
  originalContent?: string; // 原始文件内容预览
  nodeProcessing: { [key: string]: NodeProcessingData };
}

const ExecutionDetails: React.FC = () => {
  const [expandedFiles, setExpandedFiles] = useState<string[]>([]);
  const [viewingResult, setViewingResult] = useState<{fileId: string, nodeName: string} | null>(null);

  // 根据文件类型获取对应的解析节点名称
  const getParseNodeName = (fileType: string): string => {
    switch (fileType.toLowerCase()) {
      case 'txt':
      case 'docx':
      case 'doc':
      case 'pdf':
        return '文本解析节点';
      case 'jpg':
      case 'png':
      case 'gif':
      case 'bmp':
      case 'svg':
        return '图片解析节点';
      case 'mp3':
      case 'wav':
      case 'flac':
      case 'aac':
        return '音频解析节点';
      case 'mp4':
      case 'avi':
      case 'mov':
      case 'wmv':
        return '视频解析节点';
      default:
        return '文本解析节点';
    }
  };

  // 文件处理数据 - 扩展原有表格数据，添加处理结果
  const tableData: FileProcessingData[] = [
    {
      fileId: 'file-1',
      fileName: '通过评分网-1.jpg',
      fileType: 'jpg',
      fileSize: '2.5MB',
      overallStatus: '处理完成',
      currentNode: '增强节点',
      originalContent: '原始图片: 1920x1080像素，包含评分网页面截图',
      nodeProcessing: {
        '图片解析节点': { 
          status: 'completed', 
          result: '解析成功，提取图片元数据', 
          duration: '14s',
          startTime: '2024-08-19 14:52:24',
          endTime: '2024-08-19 14:52:38',
          details: '解析完成',
          outputSize: '2KB',
          hasOutput: true,
          outputType: 'metadata',
          outputPreview: '{\n  "width": 1920,\n  "height": 1080,\n  "format": "JPEG",\n  "title": "通过评分网",\n  "text_regions": ["评分", "通过", "4.5/5"],\n  "objects": ["button", "text", "logo"],\n  "colors": ["#4F46E5", "#10B981", "#F59E0B"],\n  "text_confidence": 0.95\n}'
        },
        '清洗节点': { 
          status: 'completed', 
          result: '数据清洗完成', 
          duration: '30s',
          startTime: '2024-08-19 14:52:38',
          endTime: '2024-08-19 14:53:08',
          details: '清洗完成',
          outputSize: '1.8KB',
          hasOutput: true,
          outputType: 'structured_data',
          outputPreview: '{\n  "score": 4.5,\n  "max_score": 5.0,\n  "status": "通过",\n  "category": "评分网站",\n  "confidence": 0.95,\n  "extracted_text": "评分通过4.5/5",\n  "image_quality": "high",\n  "clarity_score": 0.92\n}'
        },
        '增强节点': { 
          status: 'completed', 
          result: '增强处理完成', 
          duration: '15s',
          startTime: '2024-08-19 14:53:08',
          endTime: '2024-08-19 14:53:23',
          details: '增强完成',
          outputSize: '3.2KB',
          hasOutput: true,
          outputType: 'enhanced_data',
          outputPreview: '{\n  "score": 4.5,\n  "max_score": 5.0,\n  "status": "通过",\n  "category": "评分网站",\n  "confidence": 0.95,\n  "sentiment": "positive",\n  "keywords": ["评分", "通过", "优秀"],\n  "recommendation": "高质量内容",\n  "enhanced_metadata": {\n    "quality_score": 0.9,\n    "relevance": 0.85,\n    "visual_appeal": 0.88\n  },\n  "ai_insights": "图片显示了一个成功的评分界面，用户体验良好"\n}'
        }
      }
    },
    {
      fileId: 'file-2',
      fileName: '通过评分网-2.docx',
      fileType: 'docx',
      fileSize: '1.2MB',
      overallStatus: '处理中',
      currentNode: '清洗节点',
      originalContent: '原始文档内容: 包含评分网站分析报告，共5页内容',
      nodeProcessing: {
        '文本解析节点': { 
          status: 'completed', 
          result: '解析成功，提取文本内容', 
          duration: '29s',
          startTime: '2024-08-19 14:52:24',
          endTime: '2024-08-19 14:52:53',
          details: '解析完成',
          outputSize: '15KB',
          hasOutput: true,
          outputType: 'text',
          outputPreview: '评分网站分析报告\n\n一、概述\n本报告分析了当前评分网站的使用情况...\n\n二、数据统计\n- 总用户数: 15,432\n- 平均评分: 4.2/5.0\n- 活跃度: 78%\n- 页面浏览量: 234,567\n\n三、用户反馈\n大多数用户对评分系统表示满意...\n\n四、结论\n评分系统运行良好，用户满意度较高，建议进一步优化界面设计...'
        },
        '清洗节点': { 
          status: 'processing', 
